import * as React from "react";
import '../../index.css'

export class UserIdentityPage extends React.Component{

    constructor(props){
        super(props);
        this.state ={
            userIdentity:this.props.userIdentity
        };
    }

    componentWillMount() {

    }

    render() {
        return (
            <div>
                <div className="loader" id="loader">
                    <div className="square"/>
                    <div className="square"/>
                    <div className="square"/>
                    <div className="square"/>
                    <div className="square"/>
                </div>

                <h1>
                    {this.state.userIdentity}
                </h1>
            </div>
        );
    }
}
